const Header = () => {
	return (
		<header>
			<div className="ek-navbar">
				<div className="ek-navbar__logo">Eksho</div>
				<div className="ek-navbar__menu">
					<ul>
						<li>
							<a href="">Offer</a>
							<a href="">Offer</a>
						</li>
					</ul>
				</div>
			</div>
		</header>
	);
};

export default Header;
